import React from 'react'

function BannerName({ name, discount, link }) {
  return (
    <div className="bannerContent">
      <h3>Olá {name}</h3>
      <p>
        Ganhe desconto grátis para cada <span>${discount}</span> comprar
      </p>

      <a href={link}>Saber mais</a>
    </div>
  )
}

export default BannerName
